import librosaimport numpy as npimport matplotlib.pyplot as pltimport wavedef detect_pitch(magnitudes, pitches, t):    n = 1    # index = magnitudes[:, t].argmax()    # pitch = pitches[index, t]    indices = np.argpartition(magnitudes[:, t], -n)[-n:]    return pitches[min(indices), t]file_name = "cmaj.wav"y, sr = librosa.load(file_name)spf = wave.open(file_name,'r')#Extract Raw Audio from Wav Filesignal = spf.readframes(-1)signal = np.frombuffer(signal, 'Int16')plt.figure()plt.grid()plt.plot(signal)pitches, magnitudes = librosa.piptrack(y=y, sr=sr, n_fft=2048, threshold=0.5)freq_list = []for t in range(np.size(pitches, 1)):    freq_list.append(detect_pitch(magnitudes, pitches, t))plt.figure()plt.plot(freq_list)plt.grid()# plt.show()## plt.figure()# plt.plot(pitches)# plt.grid()# plt.show()## plt.figure()## plt.plot(magnitudes)## plt.grid()plt.show()